import axios from "axios"
export default{
    name:'mixin',
    data() {
        return {
            productionData:'',
        }
    },
    methods: {
        addItem(){
            axios.get('/store_item.json').then(
                response => {
                    this.productionData = response.data
                },
                error => {
                    alert(error.message)
                }
            )
        },
        queryDataId(id,productionData){
            for (var i = 0; i < productionData.length; i++) {
                if (id==productionData[i].id)
                return productionData[i]; 
            }
        }
    },
    mounted() {
        addItem()
    },
}
